import { Box, Heading } from '@chakra-ui/react'
import React from 'react'
import img from '../Assets/btc.png'
const PageNotFound = () => {
    return (
        <Box
            h={'80vh'}
            width={'100%'}
            backgroundImage={img}
            backgroundRepeat={'no-repeat'}
            backgroundSize={'85vh'}
            backgroundPosition={'center'}
            backgroundColor={'#444'}
            backgroundBlendMode={'multiply'}
            display={'flex'}
        >
            <Heading></Heading>
        </Box>
    )
}

export default PageNotFound
